var findTheDifference = function(s, t) {

  let sHash = new Map()
  let tHash = new Map()
  for(letter of s){

    if(!sHash.has(letter)){
      sHash.set(letter, 1)
    }
    else{
      sHash.set(letter, sHash.get(letter) + 1)
    }

  }
  console.log(...sHash.entries());
  for(letter of t){

    if(!tHash.has(letter)){
      tHash.set(letter, 1)
    }
    else{
      tHash.set(letter, tHash.get(letter) + 1)
    }

  }
  let result = ''
  tHash.forEach(function(val, key){
    if(sHash.get(key) != val||!sHash.get(key)){
      result = key
    }
  })
  return(result)
}
findTheDifference('abcd','abcde')
findTheDifference('','')